void proc_control::proc_control_copyexponent_i(const char_T s1_data[], const
  int32_T s1_size[2], int32_T idx, const char_T s_data[], int32_T k, int32_T n,
  char_T b_s1_data[], int32_T b_s1_size[2], int32_T *b_idx, int32_T *b_k,
  boolean_T *success)
{
  int32_T kexp;
  int32_T loop_ub;
  boolean_T b_success;
  *b_k = k;
  *b_idx = idx;
  b_s1_size[0] = 1;
  b_s1_size[1] = s1_size[1];
  kexp = s1_size[1] - 1;
  if (kexp >= 0) {
    std::memcpy(&b_s1_data[0], &s1_data[0], (kexp + 1) * sizeof(char_T));
  }

  *success = true;
  if (k <= n) {
    char_T tmp;
    tmp = s_data[k - 1];
    if ((tmp == 'E') || (tmp == 'e')) {
      b_s1_data[idx - 1] = 'e';
      *b_idx = idx + 1;
      *b_k = k + 1;
      while ((*b_k <= n) && (s_data[*b_k - 1] == ',')) {
        (*b_k)++;
      }

      if (*b_k <= n) {
        tmp = s_data[*b_k - 1];
        if (tmp == '-') {
          b_s1_data[idx] = '-';
          *b_idx = idx + 2;
          (*b_k)++;
        } else if (tmp == '+') {
          (*b_k)++;
        }
      }

      kexp = *b_k;
      proc_control_B.b_s1_size_b[0] = 1;
      proc_control_B.b_s1_size_b[1] = s1_size[1];
      loop_ub = s1_size[1] - 1;
      if (loop_ub >= 0) {
        std::memcpy(&proc_control_B.b_s1_data_db[0], &b_s1_data[0], (loop_ub + 1)
                    * sizeof(char_T));
      }

      proc_control_copydigits(proc_control_B.b_s1_data_db,
        proc_control_B.b_s1_size_b, *b_idx, s_data, *b_k, n, false, b_s1_data,
        b_s1_size, b_idx, &loop_ub, &b_success);
      *b_k = loop_ub;
      if (b_success && (loop_ub > kexp)) {
      } else {
        *success = false;
      }
    }
  }
}

